        {/*</Route>*/}
          <ul>
            <li><Link to={"/"}/>Home</li>
            <li><Link to={"/about"}/>About</li>
            <li><Link to={"/contact"}/>Contact Us</li>

          </ul>
          <Switch>
            <Route path={"/"} component={Home}/>
            <Route path={"/about"} component={About}/>
            <Route path={"/contact"} component={Contact}/>

          </Switch>
      </BrowserRouter>
    );
  }
}

const newRoute =()=>{
    return(
      <div>
        <p>New Route</p>
      </div>
    )
};

class Home extends Component{
    render(){
        return(
            <p>Home</p>
        )
    }
}

export default App;
